import React from "react";
import ReactDOM from "react-dom";

import App from "./components/App";

import "./styles.scss";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  rootElement
);
